import React, { useState } from 'react';
import './App.css';

function App() {
  const [theme, setTheme] = useState<string>('light');

  const toggleTheme = () => {
    setTheme(prevTheme => (prevTheme === 'light' ? 'dark' : 'light'));
  };

  return <div className={`app ${theme}`}></div>;
}

export default App;
